	new CCETAndSInsulationLayerHeader("FrameBetweenSoundproofCottonUnfold","CCETAndSInsulationLayerOperationM","CCEFrameBetweenSoundproofCottonUnfoldCmd",(void *)NULL);//框间隔音棉展开
