	new CCETAndSInsulationLayerHeader("FastenerModify","CCETAndSInsulationLayerOperationM","CCEFastenerModifyCmd",(void *)NULL);//紧固件修改
	new CCETAndSInsulationLayerHeader("FastenerInstantiation","CCETAndSInsulationLayerOperationM","CCEFastenerInstantiationCmd",(void *)NULL);//实例化紧固件装配

	//统计功能
