	//材料库管理
	new CCETAndSInsulationLayerHeader("MaterialLibSearch","CCETAndSInsulationLayerOperationM","CCEMaterialLibSearchCmd",(void *)NULL);//材料库查询
	new CCETAndSInsulationLayerHeader("MaterialLibAdd","CCETAndSInsulationLayerOperationM","CCEMaterialLibAddCmd",(void *)NULL);//材料库新增
	new CCETAndSInsulationLayerHeader("MaterialLibModify","CCETAndSInsulationLayerOperationM","CCMaterialLibModifyCmd",(void *)NULL);//材料库修改
	new CCETAndSInsulationLayerHeader("MaterialLibDelete","CCETAndSInsulationLayerOperationM","CCEMaterialLibDeleteCmd",(void *)NULL);//材料库删除

	//紧固件库管理
	new CCETAndSInsulationLayerHeader("FastenerLibSearch","CCETAndSInsulationLayerOperationM","CCEFastenerLibSearchCmd",(void *)NULL);//材料库查询
