		NewAccess(CATCmdStarter,pContractionFrameBetweenSoundproofCottonGenerationCmd,收缩段框间隔音棉生成);
		SetAccessCommand(pContractionFrameBetweenSoundproofCottonGenerationCmd,"ContractionFrameBetweenSoundproofCottonGeneration");
		SetAccessNext(pFrameBetweenSoundproofCottonGenerationCmd,pContractionFrameBetweenSoundproofCottonGenerationCmd);

		NewAccess(CATCmdStarter,pOpeningFeatureGenerationCmd,开叉特征生成);
		SetAccessCommand(pOpeningFeatureGenerationCmd,"OpeningFeatureGeneration");
