		NewAccess(CATCmdStarter,pFrameBetweenSoundproofCottonUnfoldCmd,框间隔音棉展开);
		SetAccessCommand(pFrameBetweenSoundproofCottonUnfoldCmd,"FrameBetweenSoundproofCottonUnfold");
		SetAccessNext(pFrameInSoundproofCottonUnfoldCmd,pFrameBetweenSoundproofCottonUnfoldCmd);

