		SetAccessNext(pFrameBetweenSoundproofCottonUnfoldCmd,pInstallationAndUnfoldUpdateCmd);

	NewAccess(CATCmdContainer,pFastenerInstallationSubMenu,紧固件安装);
	SetAccessNext(pSoundproofCottonCreatioSubMenu,pFastenerInstallationSubMenu);

