		SetAccessChild(pFastenerInstallationSubMenu,pFastenerDefinitionCmd);

		NewAccess(CATCmdStarter,pFastenerFastenerModifyCmd,紧固件修改);
		SetAccessCommand(pFastenerFastenerModifyCmd,"FastenerModify");
		SetAccessNext(pFastenerDefinitionCmd,pFastenerFastenerModifyCmd);

		NewAccess(CATCmdStarter,pFastenerInstantiationCmd,实例化紧固件装配);
		SetAccessCommand(pFastenerInstantiationCmd,"FastenerInstantiation");
		SetAccessNext(pFastenerFastenerModifyCmd,pFastenerInstantiationCmd);

	NewAccess(CATCmdContainer,pStatisticalFunctionSubMenu,统计功能);
	SetAccessNext(pFastenerInstallationSubMenu,pStatisticalFunctionSubMenu);

		NewAccess(CATCmdStarter,pWeightStatisticCmd,重量统计);
		SetAccessCommand(pWeightStatisticCmd,"WeightStatistic");
		SetAccessChild(pStatisticalFunctionSubMenu,pWeightStatisticCmd);

		NewAccess(CATCmdStarter,pMaterialUsingStatisticCmd,材料用量统计);
		SetAccessCommand(pMaterialUsingStatisticCmd,"MaterialUsingStatistic");
		SetAccessNext(pWeightStatisticCmd,pMaterialUsingStatisticCmd);

		NewAccess(CATCmdStarter,pFastenerNumberStatisticCmd,紧固件数量统计);
		SetAccessCommand(pFastenerNumberStatisticCmd,"FastenerNumberStatistic");
		SetAccessNext(pMaterialUsingStatisticCmd,pFastenerNumberStatisticCmd);

	NewAccess(CATCmdContainer,pMaterialLibManagementSubMenu,材料库管理);
	SetAccessNext(pStatisticalFunctionSubMenu,pMaterialLibManagementSubMenu);//

		NewAccess(CATCmdStarter,pMaterialLibSearchCmd,材料库查询);
		SetAccessCommand(pMaterialLibSearchCmd,"MaterialLibSearch");
		SetAccessChild(pMaterialLibManagementSubMenu,pMaterialLibSearchCmd);

