		SetAccessNext(pMaterialLibModifyCmd,pMaterialLibDeleteCmd);

	NewAccess(CATCmdContainer,pFastenerLibManagementSubMenu,紧固件库管理);
	SetAccessNext(pMaterialLibManagementSubMenu,pFastenerLibManagementSubMenu);

		NewAccess(CATCmdStarter,pFastenerLibSearchCmd,紧固件库查询);
